Adding a document is relatively simple, you can either add a single document represented as a JSON object or you can submit a array of object. Every document is checked for the required fields, if any docs are missing fields the entire request is rejected. POST /indexes/:index_name/documents?wait=<bool> If wait=true (recommended) the system will wait for all operations (one operation per doc) to be submitted before returning. The writer has a 20 operation buffer limit, this can be useful for client backpressure waiting for when to send more documents or not. Not waiting can quickly add a lot of load on the server which may be un-desirable. Representing Data Types Most data types can be represented as raw Example Body (Singular) { "title": ["Hello, World"], "description": ["Welcome to the next generation system."]
} Example Body (Multiple) [ { "title": ["Hello, World"], "description": ["Welcome to the next generation system."] }, { "title": ["Hello, World 2 "], "description": ["Welcome to the next generation system. Version 2"] }
]
